interventions.description:
An intravenous catheter will be placed in an arm or hand vein for injection of \[68Ga\]CBP8;

* 6-10 mCi of \[68Ga\]CBP8 or 5-9 mCi of FAPI will be injected into the Biograph mMR system. The injected dose and the time of injection will be recorded;
* The catheter will be flushed with 0.9% saline solution;
* The subjects will then be positioned on the scanner table; support devices under the back or legs will be used to enable the patient to maintain his/her position throughout the scan comfortably.

The same intravenous catheter used to inject the radiotracer will be used to inject the hepatospecific gadolinium contrast agent Eovist (Bayer, Whippany, NJ);

* After being positioned on the PET/MRI table, the nuclear medicine technologist will connect the patient to the MRI-safe power injector;
* The catheter will be flushed before and after injection with 0.9% saline solution;
* About halfway through the imaging session, the study staff will inform the patient that they are going to be administering the contrast agent and what sensations they should and should not expect;
* The contrast will then be injected.
